import React, { Component } from "react";

class AddGroup extends Component {
  state = {};
  render() {
    return (
      <div>
        <center>
          <h2>
            <label>My Group shall be called as...</label>
          </h2>
          <input
            type="text"
            name="group_name"
            id="group_name"
            placeholder="Group Name"
            style={{ width: "50%" }}
          />
        </center>
      </div>
    );
  }
}

export default AddGroup;
